import React, { Component } from "react";
class UserIcon extends Component {
  state = {};
  render() {
    return (
      <svg
        className="mr-2"
        xmlns="http://www.w3.org/2000/svg"
        width="2"
        height="20"
        viewBox="0 0 24 24"
        fill="none"
        stroke="#314ef7"
        strokeWidth="2"
      >
        <path d="M20 21v-2a4 4 0 0 0-4-4H8a4 4 0 0 0-4 4v2"></path>
        <circle cx="12" cy="7" r="4"></circle>
      </svg>
    );
  }
}

export default UserIcon;
